import React from 'react'
import {Button} from 'react-bootstrap'

export default function AddReviewForm(props){
    return (props.trigger)?(
        <div>
            <div>
                <Button>X</Button>
                <Button>Submit</Button>
            {props.children}   
            </div>    
        </div>
    ) : ""; 
};
